import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import Login from "./component/login/login";

class App extends React.Component {
  render() {
    return (
      <Router>
        <Route exact path="/" component={Login} />
      </Router>
    );
  }
}

export default App;
